import React from 'react';
import Navbar from './components/navbar';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import home from './com'

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path = '/' exact component= {home}/>
      </Routes>
    </Router>
  );
}

export default App;
